    void agregar()
    {
        Vehiculos carro = new Vehiculos();
        
        carro.Marca = marca;
        carro.Modelo = modelo;
        carro.TipoVehiculosIdTipoVehiculos = tipo;
        carro.Año = year;
        carro.Color = color;
