        carro.Precio = Pdia;
        carro.Capacidadcarga = carga;
        carro.Pasajeros = pasajeros;
        carro.Latitude = latitud;
        carro.Longitude = longitud;
        carro.Status = 1;
        db.Vehiculos.Add(carro);
        db.SaveChanges();
    }

